import React from 'react';
import './App.css';

function CollegeTimetable() {
  const daysOfWeek = ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday'];
  const timeSlots = ['8:00 AM', '9:00 AM', '10:00 AM', '11:00 AM', '12:00 PM', '1:00 PM', '2:00 PM', '3:00 PM'];

  // Sample timetable data (you can replace this with your actual data)
  const timetableData = [
    // Example: Monday
    [
      'Mathematics', 'Physics', '', '', '', 'Lunch', 'Chemistry', 'Biology',
    ],
    // Example: Tuesday
    [
      'History', '', 'Computer Science', '', '', 'Lunch', 'English', 'Geography',
    ],
    // Add data for other days here
  ];

  return (
    <div className="college-timetable">
      <table>
        <thead>
          <tr>
            <th>Time</th>
            {daysOfWeek.map((day, index) => (
              <th key={index}>{day}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {timeSlots.map((time, timeIndex) => (
            <tr key={timeIndex}>
              <td>{time}</td>
              {daysOfWeek.map((day, dayIndex) => (
                <td key={dayIndex} className={timetableData[dayIndex][timeIndex] ? '' : 'empty'}>
                  {timetableData[dayIndex][timeIndex]}
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <h1>College Timetable</h1>
      <CollegeTimetable />
    </div>
  );
}

export default App;
